export default function App() {

  return (


    <Routes>

      <Route path='/' element={<Layout />}>
        <Route index element={<PublicRoute restricted>
              <HomePage />
            </PublicRoute>} />
        <Route path='contacts' element={<PrivateRoute redirectTo="/login">
              <ContactsPage />
            </PrivateRoute>} />
        <Route path='login' element={<PublicRoute>
              <HomePage />
            </PublicRoute>} />
